import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./components/screens/Home";

function Main() {
  return (
    <>
      <BrowserRouter>
        <Routes>
            <Route path="/" element={<Home/>}  />
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default Main;
